import React from 'react';
import Slider from "react-slick";
import slide from "./slide.css";



function Multi() {

     let settings = {
        dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3,
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    }


  return (
   <div>
        <h2> Responsive </h2>
        <Slider {...settings}>
        <div className="Content_slider">
          <div className='Slider_div'>
                <img  className='slider_img' src="/images/disney.jpg" alt="project" />
          </div>
          <div className='Slider_div'>
                <img  className='slider_img' src="/images/disney.jpg" alt="project" />
          </div>
           <div className='Slider_div'>
                <img  className='slider_img' src="/images/disney.jpg" alt="project" />
          </div>
          <div className='Slider_div'>
                <img  className='slider_img' src="/images/disney.jpg" alt="project" />
          </div>
          </div>
        </Slider>
      </div>
      
  )
}

export default Multi;
